import './App.css';
import Dashboard from './Page/Dashboard';
import { Route } from "react-router-dom";

import Login from "./Page/Dashboard/login.js"

function App() {
  return (
    <div>
      <Dashboard />
       {/* other routes */}
       <Route exact path="/login" component={Login} />
      {/* other routes */}
    </div>
  );
}

export default App;
